export default function Input({ props, handleChange }){
  return(
    <div className='input-group'>
      <label htmlFor={props.name}>{props.label}</label>
      <input type={props.type} name={props.name} autoFocus={props.focus} onChange={handleChange}/>
      { props.type === 'password' ? <input type='checkbox' /> : ''}
    </div>
  )
}
